    return (
        <div>
            {
                <div class="section" id="initials">
                    <Header/>
                    <div class="content1" id="content">
                        <div class="item1" id="pic">
                            <img src="images/Sahil.jpeg" alt="image" />
                        </div>
                        <div class="item1" id="namee">
                            <div class="p1">
                                <h2>Hello I'm</h2>
                            </div>
                            <div class="p2">
                                <h1 class="glitch">
                                    <span aria-hidden="true">Sahil Aggarwal</span>
                                    Sahil Aggarwal
                                    <span aria-hidden="true">Sahil Aggarwal</span>
